	public AnAvatar() {
		Legs = new AnAngle();
		Legs.moveX(INIT_X);
		Legs.moveY(INIT_Y+40);
		Legs.getLeftLine().setZIndex(400);
		Legs.getRightLine().setZIndex(400);
		Arms = new AnAngle();
		Arms.moveX(INIT_X);
		Arms.moveY(INIT_Y);
		Torso = new ALine();
		Torso.setX(INIT_X);
		Torso.setY(INIT_X);
		Neck = new ALine();
		Neck.setHeight(10);
		Neck.setWidth(0);
		Neck.setRadius(INIT_Radius);
		Neck.setX(INIT_X);
		Neck.setY(INIT_Y-INIT_Neck);
		head = new AHead();
		text = new AStringShape();
		text.setText("");
		head.setImageFileName(headImage);
		head.setX(13);
		head.setY(INIT_Y-INIT_Head);
		head.setHeight(90);
		head.setWidth(80);
		plate = new APlate();
		plate.setImageFileName(plateImage);
		plate.setHeight(0);
		plate.setWidth(0);
		plate.setX(INIT_X-20);
		plate.setY(INIT_Y+30);
		plate.setZIndex(1);
	}
	
